import React,{useState} from "react";
import axios from "axios";

const SingUp =()  =>{
    const [email,setEmail] = useState('')
    const [password,setPassword] = useState('')
    const [firstname,setFirstName] = useState('')
    const [secondname,setSecondName] = useState('')
    const [morada,setMorada] = useState('')


    const email_change_handler =(event)=>{ setEmail(event.target.value)}
    const password_change_handler =(event)=>{ setPassword(event.target.value)}
    const firstname_change_handler =(event)=>{ setFirstName(event.target.value)}
    const secondname_change_handler =(event)=>{ setSecondName(event.target.value)}
    const morada_change_handler =(event)=>{ setMorada(event.target.value)}

    const handleSubmit = async (event) =>{
        event.preventDefault()
        try{
            const request = await axios.post('http://localhost:3000/auth/signup',{
                email,password,firstname,secondname,morada
            })
        }catch(error){
            console.log(error)
        }
        console.log(email,password,firstname,secondname)
    }

    return(
        <div>
            <form onSubmit={handleSubmit}> 
            <div>
                <label>Email</label>
                <input type="email" value={email} onChange={email_change_handler}></input>
            </div>

            <div>
                <label>Password</label>
                <input type="password" value={password} onChange={password_change_handler}></input>
            </div>

            <div>
                <label>First Name</label>
                <input type="text" value={firstname} onChange={firstname_change_handler}></input>
            </div>

            <div>
                <label>Second Name</label>
                <input type="text" value={secondname} onChange={secondname_change_handler}></input>

            </div>
            <div>
                <label>Morada</label>
                <input type="text" value={morada} onChange={morada_change_handler}></input>

            </div>
            <div>
                <button type="submit"> SingUp</button>
            </div>
            </form>
        </div>
    )
}

export default SingUp
